const CryptoList = (props) => {
    console.log(props)
    const currencyList = props.cryptoArray.map((currency, index) => {
        return (<li key={index}>Last Rate: {currency.last}</li>)
    });

    return(
        <ul>{currencyList}</ul>
    )
}

export default CryptoList;
